INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (1,'スパイダーマン','2002-05-11',121,'デヴィット・コープ','','spiderman.jpg','2021-03-13 07:01:09','2021-04-02 08:42:13');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (2,'スパイダーマン２','2002-07-10',127,'アルヴィン・サージェント','','Spiderman2-.jpg','2021-03-13 07:01:09','2021-04-02 08:41:52');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (3,'スパイダーマン３','2007-05-01',139,'サム・ライミ','ブラック・スパイダーマンとなったピーターは、その黒いスーツがもたらす新たなパワーに酔いしれ、怒りを制御することができない。 彼に何が起こったのか---? 慕っていた叔父を殺した犯人への復讐。 スパイダーマンを父の仇と信じ込む親友ハリーとの決闘。 未来を誓い合った恋人メリー・ジェーンとの心のすれ違い。 そこに現れるグウェンとの微妙な恋愛関係。 悲しき運命の連鎖が、彼を究極の戦いへと導く。 さらに新たな脅威ヴェノムがスパイダーマンに襲いかかる! 戦いは、ニュー・ゴブリン、サンドマンを巻き込み、熾烈さを増していく・・・・。','spiderman3.jpg','2021-03-13 07:01:09','2021-04-02 08:38:40');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (4,'アメイジングスパイダーマン','2012-06-30',136,'ジェームズ・ヴァンダービルト','ピーター・パーカーは、ちょっとサエナい高校生。正義感は強いが、女子にはモテない。両親は彼が幼いときに謎の失踪をとげ、以来ベンとメイの伯父夫婦に育てられてきた。ある日ピーターは父の消息を探るため、オズコープ社で遺伝子を研究するコナーズ博士を訪ね、実験中の蜘蛛にかまれてしまう。翌日、ピーターの人生は激変する。蜘蛛のように自由自在に動き回れるパワーとスピード、超感覚で危険を感知する“スパイダーセンス”を身につけたのだ。ピーターはその能力で悪と闘い、“スパイダーマン”と呼ばれるスーパーヒーローとなる。','amaizing-spiderman.jpg','2021-03-13 07:01:09','2021-04-02 08:35:53');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (5,'アメイジングスパイダーマン２','2014-04-25',142,'アレックス・カーツマン','スパイダーマンとしてニューヨークの平和を守り、ひとりの男性として恋人グウェンとの愛を育む、忙しくも充実した日々を送っていたピーター・パーカー。しかし、彼の旧友で巨大企業オズコープ社の御曹司であるハリー・オズボーンが街に戻ってきたことから、ピーターの生活は少しずつ狂い始める。一方、オズコープ社に勤める冴えない電気技師マックスは、感電事故に巻き込まれたことで、突如電撃を発する超人・エレクトロに変貌してしまう・・・！ 平凡な青年であることと、スパイダーマンとしての大いなる責任の間で葛藤してきたピーターに、更なる試練が襲い掛かる。','amaizing-spiderman2.jpg','2021-03-13 07:01:09','2021-04-02 08:29:47');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (6,'スパイダーマン ホームカミング','2017-08-11',133,'ジョン・フランシス・デイリー','ニューヨーク。15歳のピーター・パーカーはスパイダーマンだ。部活のノリで街を救う、ヒーロー気取りの高校生。そんなピーターの能力を見出し、真のヒーローとしての“道”へと導こうとするのがアイアンマンことトニー・スターク。スタークに新しいスーツまで作ってもらい興奮するピーターは、自分の力を認めてもらおうと街に飛び出す日々。そんなある日、巨大な翼で飛行する怪物が街に突如現れる。ピーターはここぞとばかり、ニューヨークの平和のために怪物退治に乗り出そうとするが、スタークに「アベンジャーズに任せておけ」と止められてしまう。「ガキ扱いは、ゴメンだ！」とピーターはその忠告を聞かずに戦いに挑むが―。','spiderman_homecomming.jpg','2021-03-13 07:01:09','2021-04-02 08:27:47');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (7,'スパイダーマン　ファーフロームホーム','2019-06-28',130,'クリス・マケナ','“ホーム”であるニューヨークを離れ、舞台はヨーロッパへ。ピーター（トム・ホランド）は親友のネッド（ジェイコブ・バタロン）やMJ（ゼンデイヤ）たちと2週間の夏休み旅行へ出かける。そこでピーターの前に突如現れるのは、S.H.I.E.L.D.の長官、ニック・フューリー（サミュエル・L・ジャクソン）だ。「出番だぞ。私と共に戦う覚悟はあるか？」とピーターに告げるが・・。','spiderman-far-from-home.jpg','2021-03-13 07:01:09','2021-04-02 08:26:46');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (8,'スターウォーズ ファントムメナス','1999-07-10',133,'ジョージ・ルーカス','遠い昔、はるかかなたの銀河系で繰り広げられる壮大な物語＜サーガ＞の第1章「スター・ウォーズ　エピソード1／ファントム・メナス」デジタルで登場。ジェダイ・マスターのクワイ＝ガン・ジンとその弟子オビ＝ワン・ケノービの二人は、平和な惑星ナブーの危機から女王パドメ・アミダラを救出する。その後惑星タトゥイーンへ立ち寄った二人は、9歳の少年アナキン・スカイウォーカーと出会い、その少年に特別な力＜フォース＞を感じとるのだが、その頃、謎の敵ダース・モールがジェダイ抹殺の為に動いていた…。','starwars-ep1jpg.jpg','2021-03-13 07:01:09','2021-04-02 08:43:38');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (9,'スターウォーズ クローンの攻撃','2002-07-13',142,'ジョナサン・ヘイルズ','アナキン・スカイウォーカーの成長と変化、そして戦いを描く「スター・ウォーズ　エピソード２／クローンの攻撃」デジタルで登場。惑星ナブーの戦いから10年後。アナキンはパドメ・アミダラが命を狙われた為護衛に付いていたが、お互いに惹かれ合う。一方、銀河共和国は、昔ジェダイであったドゥークー伯爵により新たな脅威にさらされていく。そして、オビ＝ワン・ケノービはある惑星で大量のクローンが製造されている光景を目にする。やがて、アナキンとパドメ、そしてオビ=ワンはクローン戦争に引き込まれていく。','starwars-ep2.jpg','2021-03-13 07:01:09','2021-04-02 08:39:04');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (10,'スターウォーズ　シスの復習','2005-07-09',141,'ジョージ・ルーカス','ダークサイドの強力な力を描く「スター・ウォーズ　エピソード３／シスの復讐」デジタルで登場。クローン大戦から数年、ジェダイはクローン軍を率いて、各地でドロイド軍と戦っていた。パルパティーン最高議長を拉致する事件が発生し、オビ＝ワン・ケノービとアナキン・スカイウォーカーが救出に向かい、アナキンの活躍で救出に成功する。しかし、アナキンはパドメとの秘かな愛とジェダイへの忠誠で悩み苦しむ。そしてシスのダークサイドへ誘惑されていくのであった。','starwars-ep3.png','2021-03-13 07:01:09','2021-04-02 08:40:24');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (11,'スターウォーズ　新たなる希望','1978-07-01',121,'ジョージ・ルーカス','ルーク・スカイウォーカーの銀河を巡る冒険がはじまる「スター・ウォーズ　エピソード４／新たなる希望」デジタルで登場。銀河帝国樹立から19年。砂漠の惑星タトゥイーンでルークは、長年隠れ住んでいたオビ=ワン・ケノービと出会い反乱軍の戦いに加わることを決意する。ダース・ベイダー率いる邪悪な帝国軍に捕らわれたレイア姫を救出するため、オビ=ワンは若きルークをジェダイへ導いていく。','starwars-ep1jpg.jpg','2021-03-13 07:01:09','2021-04-02 08:45:25');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (12,'スターウォーズ 帝国の逆襲','1980-06-28',124,'リー・ブラケット、ローレンス・カスダン','デス・スターを破壊された帝国軍は反乱軍を容赦なく追い続けていた。反乱軍が氷の惑星ホスから撤退すると、ルーク・スカイウォーカーは惑星ダゴバに行く。そこには隠れ暮らしていた伝説のジェダイ・マスターのヨーダがいたのだ。一方、ダース・ベイダーはベスピンのクラウド・シティで若きスカイウォーカーをダークサイドへ引き込もうと目論む。','starwars-ep2.jpg','2021-03-13 07:01:09','2021-04-02 08:45:05');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (13,'スターウォーズ ジェダイの帰還','1997-07-26',137,'ジョージ・ルーカス','壮大なるサーガのクライマックス、フォースの勝利を描く「スター・ウォーズ　エピソード６／ジェダイの帰還」デジタルで登場。帝国軍がより強力な第２デス・スターの建造を進めている中、反乱軍は総力を結集しデス・スターへ攻撃の準備を計画していた。一方、ルーク・スカイウォーカーは、邪悪な皇帝の前でダース・ベイダーとの最後の戦いに挑む。','starwars-ep3.png','2021-03-13 07:01:09','2021-04-02 08:44:11');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (14,'スターウォーズ　フォースの覚醒','2015-12-18',136,'j・j・エイブラムス','世界で愛され続けるSFアドベンチャー「スター・ウォーズ」シリーズの第7作目。『ジェダイの帰還』の30年後、帝国軍の残党「ファースト・オーダー」が台頭するなか、姿を消したとされる最後のジェダイ・ルークの手がかりを探す。','starwars-ep7.jpg','2021-03-13 07:01:09','2021-04-02 08:28:12');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (15,'スターウォーズ 最後のジェダイ','2017-12-15',152,'ライアン・ジョンソン','『スター・ウォーズ／フォースの覚醒』のその後を描く、誰も観たことのない衝撃の「スター・ウォーズ」。ついにフォ ースを覚醒させたレイと、ダース・ベイダーを継ごうとするカイロ・レン。伝説のジェダイ、ルーク・スカイウォーカーの出現は何をもたらすのか？そして、“光”と“闇”の間で揺れ動く二人を待ち受ける“衝撃の運命”とは？','starwars-ep8.jpg','2021-03-13 07:01:09','2021-04-02 08:27:20');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (16,'スターウォーズ スカイウォーカーの夜明け','2019-12-20',142,'j・j・エイブラムス','はるか彼方の銀河系で繰り広げられる、スカイウォーカー家を中心とした壮大な<サーガ>の結末は、“光と闇”のフォースをめぐる最後の決戦に託された──祖父ダース・ベイダーの遺志を受け継いだカイロ・レン。伝説のジェダイ、ルーク・スカイウォーカーの想いを引き継ぎ、フォースの力を覚醒させたレイ。そして、R2-D2、C-3PO、BB-8 ら忠実なドロイドと共に銀河の自由を求めて戦い続ける、生きる英雄レイア将軍、天才パイロットのポー、元ストームトルーパーのフィンら、レジスタンスの同志たち...。さらに、ハン・ソロの永遠の好敵手ランド・カルリジアンもエピソード・シリーズでは『スター・ウォーズ エピソード 6/ジェダイの帰還』以来の再登場。果たして、彼らを待ち受ける運命とは?そして、いかなるエンディングを迎えるのか?','starwars-ep9.jpg','2021-03-13 07:01:09','2021-04-02 08:26:20');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (17,'ハリー・ポッターと賢者の石','2001-12-01',152,'スティーブ・クローヴス','全世界に魔法をかけたファンタジー・アドベンチャーの最高傑作、第1章。 孤独な日々を送る少年、ハリー・ポッターの下に「ホグワーツ魔法魔術学校への入学を許可します」という手紙が届き…。','harrypotter-1.jpg','2021-03-13 07:01:09','2021-04-02 08:42:48');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (18,'ハリーポッターと秘密の部屋','2002-11-23',161,'スティーブ・クローヴス','史上最強のファンタジー、2年目の冒険が始まる！！もっと冒険、もっと勇気、もっと魔法が溢れ出る！！','harrypotter-2.jpg','2021-03-13 07:01:09','2021-04-02 08:41:16');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (19,'ハリー・ポッターとアズカバンの囚人','2004-06-26',142,'スティーブ・クローブス','13歳になったハリーを待ち受けるのは、不吉な死の予言さえ告げられる中、ハリーが直面する両親の死の真相。今まで見えなかったものが見え始め、わからなかったことがわかり始める第3章。','harrypotter-3.jpeg','2021-03-13 07:01:09','2021-04-02 08:40:59');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (20,'ハリー・ポッターと炎のゴブレット','2005-11-26',157,'スティーブ・クローブス','暗黒の支配者、ついに復活―。史上最大のスケールで描かれる激動の第4章！','harrypotter-4.jpg','2021-03-13 07:01:09','2021-04-02 08:39:56');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (21,'ハリー・ポッター不死鳥の騎士団','2007-07-20',138,'マイケル・ゴルデンバーグ','壮絶なバトルがついに始まる！ハリーの本当の秘密、解禁。','harrypotter5.jpg','2021-03-13 07:01:09','2021-04-02 08:38:06');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (22,'ハリー・ポッターと謎のプリンス','2009-07-15',154,'スティーブ・クローブス','史上最強のファンタジー第6章、クライマックスは、ここから始まる！','harrypotter6.jpg','2021-03-13 07:01:09','2021-04-02 08:37:22');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (23,'ハリー・ポッター死の秘宝 PART1','2010-11-19',146,'スティーブ・クローブス','史上最強のファンタジー　ついに、完結へ。二部構成で贈る最終章、歴史的フィナーレの幕が開く！','harrypotter7.jpg','2021-03-13 07:01:09','2021-04-02 08:30:38');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (24,'ハリー・ポッターと死の秘宝 PART2','2011-07-15',130,'スティーブ・クローブス','映画史上に残る最強シリーズの歴史的フィナーレ。シリーズ最高の感動と興奮を手に入れよう！','harrypotter8.jpg','2021-03-13 07:01:09','2021-04-02 08:28:45');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (25,'トランスフォーマー','2007-08-04',144,'アレックス・カーツマン','中東のカタール米軍基地を謎の巨大ロボットが襲撃。ロボットは軍用ヘリに姿を変え、まるで意志があるかのように攻撃を仕掛けてきた。かつてない緊急事態に、敵の情報収集を急ぐアメリカ政府。そのころ、アメリカの冴えない高校生サムは中古のカマロを手に入れる。しかし、そのカマロは宇宙の彼方からやって来たロボット生命体“トランスフォーマー”の一員で、宇宙征服を企む悪の“トランスフォーマー”メガトロンを追って地球を訪れたことを知り……。','30963.jpeg','2021-03-19 09:54:05','2021-04-02 08:37:43');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (29,'シン・エヴァンゲリオン劇場版','2021-03-08',NULL,'','','20210321-00241299-hbolz-000-2-view.jpeg','2021-03-24 08:59:11','2021-04-02 08:23:37');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (30,'騙し絵の牙','2021-03-26',113,'吉田大八','大手出版社「薫風社」に激震走る!かねてからの出版不況に加えて創業一族の社長が急逝、次期社長を巡って権力争いが勃発。専務・東松(佐藤浩市)が進める大改革で、雑誌は次々と廃刊のピンチに。会社のお荷物雑誌「トリニティ」の変わり者編集長・速水(大泉洋)も、無理難題を押し付けられて窮地に立たされる...が、この一見頼りない男、実は笑顔の裏にとんでもない“牙”を秘めていた!嘘、裏切り、リーク、告発。クセモノ揃いの上層部・作家・同僚たちの陰謀が渦巻く中、新人編集者・高野(松岡茉優)を巻き込んだ速水の生き残りを賭けた“大逆転”の奇策とは!?','damasienokiba.jpeg','2021-03-24 09:39:01','2021-04-02 08:18:29');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (31,'モンスターハンター','2021-03-26',103,'ポール・W・S・アンダーソン','消息を絶った偵察小隊の捜索に当たっていたアルテミス（ミラ・ジョヴォヴィッチ）率いる特殊部隊は、激しい砂嵐に飲み込まれてしまう。砂嵐が去った後、彼らのの目の前に現れたのは、未知なる世界と・・・ありえないサイズの超巨大モンスター！果たして元の世界に戻る方法はあるのか? すべての真実を知るためには、次々襲来する巨大モンスター達を倒し、生き残るしかない。狩るのは人間か? モンスターか!? 究極のサバイバルがいま始まる!','monster_hunter.jpeg','2021-03-24 09:54:12','2021-04-02 08:18:55');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (32,'TENNET','2020-09-18',150,'クリストファー・ノーラン','「その言葉の使い方次第で、未来が決まる」――主人公に課せられたミッションは、人類がずっと信じ続けてきた現在から未来に進む〈時間のルール〉から脱出すること。\r\n時間に隠された衝撃の秘密を解き明かし、第三次世界大戦を止めるのだ。\r\nミッションのキーワードは〈TENET（テネット）〉。\r\n突然、国家を揺るがす巨大な任務に巻き込まれた名もなき男（ジョン・デイビット・ワシントン）とその相棒（ロバート・パティンソン）は、任務を遂行する事が出来るのか！？','tennet.jpeg','2021-03-24 09:59:37','2021-04-02 08:25:59');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (33,'浅田家！','2020-10-20',130,'中野量太','幼いころ、写真好きの父からカメラを譲ってもらった政志（二宮和也）は、昔から写真を撮るのが大好きだった。そんな彼が、家族全員を巻き込んで、消防士、レーサー、ヒーロー、大食い選手権……。それぞれが“なりたかった職業”“やってみたかったこと”をテーマにコスプレし、その姿を撮影したユニークすぎる《家族写真》が、なんと写真界の芥川賞・木村伊兵衛写真賞を受賞！ 受賞をきっかけに日本中の家族から撮影依頼を受け、写真家としてようやく軌道に乗り始めたとき、東日本大震災が起こる――。\r\nかつて撮影した家族の安否を確かめるために向かった被災地で、政志が目にしたのは、家族や家を失った人々の姿だった。\r\n「家族ってなんだろう？」\r\n「写真家の自分にできることは何だろう？」\r\nシャッターを切ることができず、自問自答をくり返す政志だったが、ある時、津波で泥だらけになった写真を一枚一枚洗って、家族の元に返すボランティア活動に励む人々と出会う。彼らと共に《写真洗浄》を続け、そこで写真を見つけ嬉しそうに帰っていく人々の笑顔に触れることで、次第に《写真の持つチカラ》を信じられるようになる。そんな時、一人の少女が現れる。\r\n「私も家族写真を撮って欲しい！」\r\nそれは、津波で父親を失った少女の願いだった――。','asadake-poster03.jpeg','2021-03-28 05:10:16','2021-04-02 08:24:27');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (34,'花束みたいな恋をした','2021-01-29',124,'坂元裕二','東京・京王線の明大前駅で終電を逃したことから偶然に出会った大学生の山音麦<やまねむぎ>（菅田将暉）と八谷絹<はちやきぬ>（有村架純）。\r\n好きな音楽や映画がほとんど同じで、あっという間に恋に落ちた麦と絹は、大学を卒業してフリーターをしながら同棲を始める。拾った猫に二人で名前をつけて、渋谷パルコが閉店してもスマスマが最終回を迎えても、日々の現状維持を目標に二人は就職活動を続けるが──。','640.jpeg','2021-03-29 04:52:30','2021-04-02 08:23:56');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (35,'JUNK HEAD','2021-03-26',101,'','環境破壊が止まらず、もはや地上は住めないほど汚染された。人類は地下開発を目指し、その労働力として人工生命体マリガンを創造する。ところが、自我に目覚めたマリガンが人類に反乱、地下を乗っ取ってしまう。それから1600年──遺伝子操作により永遠と言える命を得た人類は、その代償として生殖能力を失った。そんな人類に新種のウイルスが襲いかかり、人口の30%が失われる。絶滅の危機に瀕した人類は、独自に進化していたマリガンの調査を開始。政府が募集した地下調査員に、生徒が激減したダンス講師の“主人公”が名乗りを上げる。地下へと潜入し、〈死〉と隣り合わせになることで命を実感した主人公は、マリガンたちと協力して人類再生の道を探る。今、広大な地下世界の迷宮で、クセ者ぞろいのマリガンとの奇想天外な冒険が始まる！','_.jpeg','2021-03-29 06:59:57','2021-04-02 08:19:11');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (36,'トムとジェリー','2021-03-19',101,'Eric Gravning マイケル・H・ウェバー スコット・ノイスタッター','大嫌いだけど、好き ―― ケンカばかりのトムジェリが〈まさかの友情〉で奇跡を起こす!\r\nとあるニューヨークの一流ホテルで、世界中が注目するセレブカップルの「世紀のウェディングパーティー」が行われることに。\r\nホテル中が準備に追われる中で、ある事件が起こる――あのいたずら好きネズミのジェリーがホテルに引っ越してきて大騒ぎ！\r\n新人スタッフのケイラは急遽“ネズミ対策”で猫のトムをボーイとして雇うが、\r\nトムとジェリーはニューヨーク中を巻き込んだ壮絶なおいかけっこを繰り広げ、\r\nついには“ある陰謀”に巻き込まれてウェディングパーティーを台無しにしてしまい―――。\r\nクビになってしまったケイラのため、そして新郎新婦のため、ふたりはタッグを組むことに。\r\nはたしてトムとジェリーは、最高のウェディングパーティーを開くことができるのか！？','top_kv_sp.jpeg','2021-03-30 08:17:43','2021-04-02 08:20:54');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (38,'Summer of 85','2021-08-20',100,'フランソワ・オゾン','セーリングを楽しもうとヨットで⼀⼈沖に出た16歳のアレックス。突然の嵐に⾒舞われ転覆した彼を救助したのは、18歳のダヴィド。⼆⼈は急速に惹かれ合い、友情を超えやがて恋愛感情で結ばれる。アレックスにとってはこれが初めての恋だった。\r\n互いに深く想い合う中、ダヴィドの提案で「どちらかが先に死んだら、残された⽅はその墓の上で踊る」という誓いを⽴てる⼆⼈。\r\nしかし、ダヴィドの不慮の事故によって恋焦がれた⽇々は突如終わりを迎える。悲しみと絶望に暮れ、⽣きる希望を失ったアレックスを突き動かしたのは、ダヴィドとあの夜に交わした誓いだった─。','summerof852.jpeg','2021-03-30 08:38:48','2021-04-02 08:18:09');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (39,'ノマドランド','2021-03-26',108,'クロエ・ジャオ','リーマンショック後、企業の倒産とともに、長年住み慣れたネバダ州の企業城下町の住処を失った60代女性ファーン（フランシス・マクドーマンド）。彼女の選択は、キャンピングカーに全ての思い出を詰め込んで、車上生活者、“現代のノマド（遊牧民）”として、過酷な季節労働の現場を渡り歩くことだった。その日その日を懸命に乗り越えながら、往く先々で出会うノマドたちとの心の交流とともに、誇りを持った彼女の自由な旅は続いていく。大きな反響を生んだ原作ノンフィクションをもとに、そこで描かれる実在のノマドたちとともに見つめる今を生きる希望を、広大な西部の自然の中で探し求めるロードムービー。','Nomadland.jpeg','2021-03-30 08:57:45','2021-04-02 08:20:36');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (40,'ミナリ','2021-03-19',116,'リー・アイザック・チョン','1980年代、農業で成功することを夢みる韓国系移民のジェイコブは、アメリカはアーカンソー州の高原に、家族と共に引っ越してきた。荒れた土地とボロボロのトレーラーハウスを見た妻のモニカは、いつまでも心は少年の夫の冒険に危険な匂いを感じるが、しっかり者の長女アンと心臓に病を持つが好奇心旺盛な弟のデビッドは、新しい土地に希望を見つけていく。まもなく毒舌で破天荒な祖母も加わり、デビッドと一風変わった絆を結ぶ。だが、水が干上がり、作物は売れず、追い詰められた一家に、思いもしない事態が立ち上がる──。','minari.jpeg','2021-03-30 09:45:17','2021-04-02 08:21:57');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (41,'まともじゃないのは君も一緒','2021-03-19',98,'高田亮','予備校講師・大野は、独身・彼女なし。ずっと 1 人で大好きな数学の世界で生きてきた。今の生活に不満はないが、このままずっと 1 人なのかと不安になることもある。自分だって普通に結婚したい。ただ、普通が何かわからない。女の子とデートをしてもなんだかピントがずれているような空気は感じているが、どうしていいのかはわからない大野。教え子の香住はそんな大野を”普通じゃない”と指摘してくれる唯一の相手。大野は香住に「どうしたら普通になれる？普通を教えてほしい。」と頼み込むのだが・・・。','matomojynainohakimimo.jpeg','2021-03-30 10:21:04','2021-04-02 08:23:19');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (43,'アヴェンジャーズ','2012-08-14',144,'ジョス・ウェドン','地球侵略へのカウントダウンが開始された時、７０億人もの人類の未来は、最強の力を持つヒーローたちに託された。彼らの名は、アベンジャーズ。だが、意思に反して集結させられた彼らはそれぞれの心の傷に囚われ、ひとつのチームとして戦うことを拒み続ける。次第に明らかにされるアベンジャーズの知られざる過去と苦悩…。人類史上最大の敵を前に、果たして彼らは地球を救うことができるのか？ それとも…？','avengers.jpg','2021-04-02 08:57:00','2021-04-02 08:57:00');
INSERT INTO movies (id, name, open_house, running_time, screen_writer, summary, image, created_at, updated_at) VALUES (44,'アベンジャーズ／エイジ・オブ・ウルトロン','2015-07-04',141,'ジョス・ウェドン','アイアンマンこと“戦う実業家”トニー・スタークが開発した＜ウルトロン計画＞━━それは、人工知能による完璧な平和維持システム。しかし、進化と増殖を続けるウルトロンが選択した“究極の平和”とは、地球を脅かす唯一の存在＝人類を抹消することだった…。世界中の都市を襲う人類滅亡の脅威に、最強チーム“アベンジャーズ”が再び結集。絶体絶命の彼らに残された最後の武器は、「愛する人を守りたい」という熱い思いだけ…。','avengers2.png','2021-04-02 09:15:57','2021-04-02 09:15:57');
