INSERT INTO comments (id, user_id, movie_id, comment, created_at, updated_at, rate) VALUES (7,4,7,'えっ え〜…なんか…思ってたより怖い映画だった 少年少女のひと夏の青春ムービーだと思って騙された いや確かに少年少女のひと夏の青春ムービーだったんですが、色んなものを詰めすぎ エンドゲーム見た2日後に見る映画ではなかった…だってツタヤの返却期限が迫ってたから…\r\n自分たちの生活を脅かす奴らが宇宙やら異次元やらから現れるたびにヒーローが立ち上がり必ず世界を救ってきた、救われてきた、人々はずっとそんな状況下にいたから仕方ないのかもしれないけど、これまで戦ってきたヒーローを失ったばかりなのに、新しいヒーローが登場したらすぐカッコいい！ステキ！あのヒーローの名前は？ってなるの普通にショックだった ていうかこの世界におけるヒーローってファーストアベンジャーの登場時点で既にある意味エンタメ的存在なんだよね ここまで考えてそもそも私もエンタメとして彼らの戦いを楽しんで眺めてるじゃん、って気づいてヤ、ヤダ〜…になった 今更か？\r\nこれまでもCGが多用されてきた映画シリーズの作中で「これはCG映像です！」「これは本物の映像です！」「と見せかけてやっぱりCGです！」「そして今僕が身につけているこれはモーションキャプチャースーツです！」ってやってくるのヤバいし、「何が本当で何が嘘か君には見抜けるかなスパイダーマンくん」というのを散々やった締めで「ちなみにこれまで我々の作品をずっと見てきてくれた観客の皆さんはどうですか？」をやってくるのもヤバすぎて脳バグった 助けてください\r\n「大衆は新たなヒーローを求めている、次はお前の番だ」というラストも衝撃 トニー本人の 「私がアイアンマンだ」で始まったストーリーはジェイ・ジョナ・ジェイムソンの「スパイダーマンの正体はピーター・パーカーだ！」で締めくくられ、作品間の壁は壊され、世代交代の宣言と共に新章に突入する これを楽しみ！というよりどうしても恐ろしいと感じてしまうのはやっぱりピーターが高校生だからだと思う ずっと親愛なる隣人ではいられないのかな エンドゲームのラストを見ているときに「あ〜ファーフロムホームってそういう…」と思ったけど次は「ノーウェイホーム」か…','2021-03-24 09:28:05','2021-03-30 05:20:59',2.79625);
INSERT INTO comments (id, user_id, movie_id, comment, created_at, updated_at, rate) VALUES (8,3,33,'心温まる家族の話！！\r\n今は気軽にスマホで写真が撮れる時代だけど、やっぱり現像されたものは特別だし、大切な思い出として残るなあと。\r\n\r\n\r\n政志の飄々として掴みどころがないけど人たらしで憎めない感じが二宮くんぴったりでした。\r\n妻夫木さんいいお兄ちゃんでした。あれだけ普通のいい人を演じられるのもすごい。\r\n黒木華ちゃんの役もすごい好きです！！\r\n菅田くんは言われなかったらわからないくらい完全にオーラを消し去って馴染んでて本当にすごい役者さんだなって思いました。\r\nこれだけアカデミー賞受賞者が集まってる映画なかなかないよね。すごすぎ。\r\n\r\n監督も言ってたけど、200万円のシーン好きです笑\r\nあと最後のオチも最高。浅田家らしい！','2021-03-30 05:08:33','2021-03-30 05:08:33',2.83313);
INSERT INTO comments (id, user_id, movie_id, comment, created_at, updated_at, rate) VALUES (9,3,34,'就職など歳をとっていくにつれて大事なこと、好きなことの優先順位が下がってだんだん好きじゃなくなって、忘れていくのはしょうがないと思うけれど、出来るだけ忘れたくないなと思いたい。','2021-03-30 05:11:54','2021-03-30 05:11:54',4.49312);
INSERT INTO comments (id, user_id, movie_id, comment, created_at, updated_at, rate) VALUES (10,3,29,'こんなにハマったアニメは初めて。\r\n見るごとに色んな解釈ができるようになるし、旧劇から新劇で庵野監督が精神的に落ち着いたことが伺えて良かった。笑\r\nシリーズ通して納得いく終わり方だったと思う。\r\nかと言って理解できないところ多々なので、はやくDVD出ないかな','2021-03-30 05:12:54','2021-03-30 05:12:54',4.81125);
INSERT INTO comments (id, user_id, movie_id, comment, created_at, updated_at, rate) VALUES (11,4,4,'スパイダーマンも好きやったけど\r\nアメイジングスパイダーマンも好きやった！\r\nめっちゃ良い〜かっこいい！！','2021-03-30 05:21:37','2021-04-02 08:36:37',3.73344);
